('Laptop Apple MacBook Pro M1 2020 16GB/512GB',44990000,2,1,'Apple Macbook Pro M1 2020 được nâng cấp với bộ vi xử lý mới cực kỳ mạnh mẽ, chiếc laptop này sẽ phục vụ tốt cho công việc của bạn, đặc biệt cho lĩnh vực đồ họa, kỹ thuật.\nTăng cường không gian lưu trữ, tốc độ xử lý','13.3\"Retina (2560 x 1600)','Mac OS','16 GB','Khoảng 10 tiếng','2021-01-02',null,true,0),
('Laptop Apple MacBook Pro M1 2020 8GB/256GB',34990000,2,1,'Apple Macbook Pro M1 2020 sở hữu thiết kế sang trọng kế thừa từ các thế hệ trước và bên trong là một cấu hình ấn tượng từ con chip M1 lần đầu tiên xuất hiện trên MacBook Pro, hiệu năng CPU của máy tăng đến 2.8 lần, hiệu năng GPU tăng 5 lần.\nThiết kế mỏng nhẹ, cao cấp','13.3\"Retina (2560 x 1600)','Mac OS','8 GB','Khoảng 10 tiếng','2021-02-25',null,true,0),
('Laptop Apple MacBook Air M1 2020 8GB/256GB/7-core GPU',28990000,2,1,'Laptop Apple MacBook Air M1 2020 thuộc dòng laptop cao cấp sang trọng có cấu hình mạnh mẽ, chinh phục được các tính năng văn phòng lẫn đồ hoạ mà bạn mong muốn, thời lượng pin dài, thiết kế mỏng nhẹ sẽ đáp ứng tốt các nhu cầu làm việc của bạn.\nChip Apple M1 tốc độ xử lý nhanh gấp 3.5 lần thế hệ trước','13.3\"Retina (2560 x 1600)','Mac OS','8 GB','Khoảng 10 tiếng','2021-02-10',null,true,0),
