('Apple Watch S5 LTE 44mm viền thép dây thép bạc',18990000,4,9,'Apple Watch S5 LTE 44mm viền thép dây thép bạc có dây đeo dạng lưới đan mỏng, được gia công hoàn toàn từ thép không gỉ, vừa quý phái lại vừa mang cảm mát tay khi mang. Màn hình cảm ứng có mặt kính Saphire cứng cáp giúp bảo vệ chiếc đồng hồ của bạn an toàn trước những va đập không mong muốn. Apple Watch không chỉ là đồng hồ với nhiều tính năng thông minh mà còn là một phụ kiện thời trang cao cấp','OLED1.78 inch','iOS 13 trở lên',NULL,'Khoảng 1.5 ngày','2021-04-22',null,true,0),
('Apple Watch S5 LTE 40mm viền thép dây thép',17990000,4,9,'Apple Watch S5 LTE 40mm viền thép dây thép vàng được trang bị bộ khung viền cứng cáp, dây đeo bằng thép dạng lưới đan mỏng tôn lên nét hiện đại, tinh tế. Đồng hồ sở hữu màn hình OLED 1.57 inch giúp hiển thị thông tin rõ ràng, sắc nét. Mặt kính cường lực Sapphire giúp bảo vệ đồng hồ an toàn trước những va chạm thường ngày.','OLED1.57 inch','iOS 13 trở lên',NULL,'Khoảng 1.5 ngày','2021-04-22',null,true,0),
('Apple Watch S6 LTE 40mm viền nhôm dây cao su',11992000,4,9,'Kiểu dáng thời thượng đi cùng sắc hồng nữ tính, trẻ trung\nApple Watch S6 LTE 40mm viền nhôm dây cao su hồng được trang bị khung viền nhôm và mặt kính Ion-X strengthened glass bền bỉ và cứng cáp, chịu lực tốt, cho bạn thoải mái vận động, không ngại những va đập thường ngày. Dây đeo cao su không thấm nước, êm nhẹ, cho bạn cảm giác dễ chịu suốt ngày dài.','OLED1.57 inch','iOS 14 trở lên',NULL,'Khoảng 1.5 ngày','2021-03-11',null,true,0),
('Vòng đeo tay thông minh Mi Band 6 ',990000,4,8,'Vòng đeo tay thông minh Mi Band 6 là phiên bản đáng mong đợi của nhà Xiaomi với thiết kế màn hình tràn viền cho bạn góc nhìn tốt hơn. Mặt kính cường lực chống trầy xước tốt cùng dây đeo cao su với thiết kế ôm trọn cổ tay, không thấm nước khi đeo, mang lại cho bạn cảm giác dễ chịu cả ngày dài.','AMOLED 1.56 inch','Android 5.0 trở lên IOS 10 trở lên',NULL,'Khoảng 15 ngày','2020-01-14',null,true,0),
('Samsung Galaxy Watch 4 LTE Classic 46mm',9490000,4,5,'Samsung Galaxy Watch 4 LTE Classic 46mm mang nét sang trọng, hiện đại cùng với bộ khung viền thép không gỉ cứng cáp, màn hình SUPER AMOLED được bao bọc bởi lớp kính cường lực Gorrilla Glass Dx+ bền bỉ, chịu lực tốt. Dây đeo silicone êm nhẹ, độ đàn hồi cao, không thấm nước, thiết kế đục lỗ cho người dùng sự thông thoáng khi mang.','SUPER AMOLED1.36 inch','Android dùng Google Mobile Service',NULL,'Khoảng 1.5 ngày','2021-02-11',null,true,0),
('Samsung Galaxy Watch 3 LTE 45mm viền thép dây da',6990000,4,5,'Thiết kế sang trọng nhưng không kém phần thoải mái\nSamsung Galaxy Watch 3 LTE 45mm dây da có thiết kế cổ điển, lịch lãm và hiện đại. Với tấm nền Super AMOLED 1.4 inch và độ phân giải 360x360 pixels, đồng hồ có khả năng hiển thị xuất sắc với màu sắc rực rỡ, thông tin hiển thị đầy đủ, rõ ràng. Khung viền xoay bezel được thay thế cho mặt xoay cảm ứng ở bản Watch Active 2','SUPER AMOLED1.4 inch','Android 5.0 trở lên iOS 9 trở lên',NULL,'Khoảng 2 ngày','2020-05-14',null,true,0);

