('Máy tính bảng Samsung Galaxy Tab S6 Lite',9090000,3,5,'Sau thành công của Galaxy Tab S6, Samsung tiếp tục chinh phục người dùng với Galaxy Tab S6 Lite có phân khúc giá rẻ hơn. Thiết bị vẫn hỗ trợ bút S Pen thần thánh, thiết kế kim loại cao cấp và màn hình, âm thanh giải trí đỉnh cao.\nThiết kế thời thượng và cao cấp','10.4\"PLS LCD','Android 10','4 GB','7040 mAh10 W','2020-06-05',null,true,0),
('Máy tính bảng Samsung Galaxy Tab A7 Lite',4140000,3,5,'Galaxy Tab A7 Lite là phiên bản rút gọn của dòng máy tính bảng \"ăn khách\" Galaxy Tab A7 thuộc thương hiệu Samsung, đáp ứng nhu cầu giải trí của khách hàng thuộc phân khúc bình dân với màn hình lớn nhưng vẫn gọn nhẹ hợp túi tiền.\nThiết kế siêu mỏng nhẹ','8.7\"TFT LCD','Android 11','3 GB','5100 mAh15 W','2019-10-12',null,true,0),
('Laptop Apple MacBook Pro 16 M1 Max 2021',90990000,2,1,'Thật ấn tượng với Apple MacBook Pro 16 M1 Max 2021 mang trên mình \"bộ áo mới\" độc đáo, cuốn hút mọi ánh nhìn cùng màn hình tai thỏ lần đầu tiên xuất hiện ở dòng Mac và ẩn bên trong là bộ cấu hình mạnh mẽ tuyệt vời đến từ con chip M1 Max tân tiến.\nHiệu năng vượt trội, đỉnh cao, cân mọi tác vụ','16.2 inchLiquid Retina XDR display (3456 x 2234)120Hz','Mac OS','32 GB','Khoảng 10 tiếng','2021-12-11',null,true,0);